import numpy as np
import random

def task_func(MIN_WORDS, MAX_WORDS, WORDS_POOL):
    length = random.randint(MIN_WORDS, MAX_WORDS)
    words = random.choices(WORDS_POOL, k=length)
    if length % 2 == 0:
        mid = length // 2
        words = words[:mid] + words[mid:][::-1]
    else:
        mid = length // 2
        words = words[:mid] + [words[mid]] + words[mid+1:][::-1]
    return ' '.join(words)

from random import shuffle, randint
import pandas as pd

def task_func(l, n_groups = 5):
    shuffle(l)
    series = []
    for _ in range(len(l) * n_groups):
        elem = l[_ % len(l)]
        n = randint(1, n_groups)
        if len(elem) > n:
            elem = elem[n:] + elem[:n]
        series.append(elem)
    return pd.Series(series)
